import React from 'react';

export const AssetCategory = () => (
  <nav aria-label="breadcrumb">
  <ol className="breadcrumb">
    <Link className="breadcrumb-item"><a href="#">Furniture</a></Link>
    <Link className="breadcrumb-item"><a href="#">Living Room</a></Link>
    <Link className="breadcrumb-item active" aria-current="page">Chairs</Link>
  </ol>
</nav>

);
